let postsElement=
props.posts.map(p=> <Post message={p.message} likeCount={p.likeCount}/> );

  return <div className={s.postsBlock}>
    <h3>My post</h3>
    <div>
      <div>
        <textarea></textarea>
      </div>
      <div>
        <button>Add post</button>
      </div>

    </div>

